import React from 'react';
import './Roadmap.css';

const Roadmap = ({ handleUploadClick }) => { // handleUploadClick을 props로 받음
  return (
    <div className="background-container2">
      <button className="button2" onClick={handleUploadClick}>
        Upload 버튼
      </button>
    </div>
  );
};

export default Roadmap;
